    providedIn: 'root'
})
export class IsLoggedInGuard implements CanActivate {
    constructor(private authService: AuthService, private router: Router) { }

    canActivate(): boolean {
        if (this.authService.isAuthenticated(['admin'])) {
            con
            return true;
        } else {
            this.router.navigate(['/login']);
